#include "TTTPlayers.h"
#include "Random.h"

// Returns a random valid play
std::vector<int> TTTRandomPlayer::getPlay(TTTGame& myGame, int player) {
	std::vector<std::vector<int>> temp = myGame.getValidPlays();
	if (temp.size() > 0) {
		return temp.at(Random::getIndex(temp.size()));
	}
	return std::vector<int>(2, -1);
}

// Sets up the imperfect player with a given optimal play percentage
TTTImperfectPlayer::TTTImperfectPlayer(double optimalPlayPercentage) {
	myMMPlayer = TTTMinimaxPlayer();
	myRandPlayer = TTTRandomPlayer();
	myOptimalPlayPercentage = optimalPlayPercentage;
}

// Returns the optimal or random play, selected at random
std::vector<int> TTTImperfectPlayer::getPlay(TTTGame& myGame, int player) {
	if (Random::getDouble(0.0, 100.0) < myOptimalPlayPercentage) {
		return myMMPlayer.getPlay(myGame, player);
	}
	return myRandPlayer.getPlay(myGame, player);
}

// Sets up the minimax optimal player
TTTMinimaxPlayer::TTTMinimaxPlayer() {
	p1BestPlays = std::map<int, std::vector<int>>();
	p2BestPlays = std::map<int, std::vector<int>>();
	loadPlayer1();
	loadPlayer2();
}

// Returns the optimal play from a precomputed dictionary
std::vector<int> TTTMinimaxPlayer::getPlay(TTTGame& myGame, int player) {
	std::map<int, std::vector<int>>::iterator it;
	if (player == 1) {
		it = p1BestPlays.find(myGame.base3Board());
		if (it != p1BestPlays.end()) {
			return it->second;
		}
	}
	else if (player == 2) {
		it = p2BestPlays.find(myGame.base3Board());
		if (it != p2BestPlays.end()) {
			return it->second;
		}
	}
	return std::vector<int>(2, -1);
}

